import { Box, Paper, Typography } from '@mui/material'
import React from 'react'

export const About = () => {
    return (
        <Box
            display={'flex'}
            flexDirection={'column'}
            fullHeight={true}
            sx={{
                alignContent: 'center',
                justifyContent: 'center',
                textAlign: 'center'
            }}
        >
            <Typography variant={'h1'}>Hi, my name is William Ho</Typography>
        </Box>
    )

}
